import React, { useState } from 'react';
import {
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  Box,
  Button,
  LinearProgress,
  Chip,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  IconButton,
  Alert,
} from '@mui/material';
import {
  CloudUpload,
  Analytics,
  Visibility,
  Download,
  Refresh,
  TrendingUp,
} from '@mui/icons-material';
import { useDropzone } from 'react-dropzone';

interface LogEntry {
  id: string;
  timestamp: string;
  source: string;
  type: 'vpc_flow' | 'cloudtrail' | 'iam';
  anomalies: number;
  status: 'processed' | 'processing' | 'failed';
  size: string;
}

const Logs: React.FC = () => {
  const [uploadProgress, setUploadProgress] = useState(0);
  const [isUploading, setIsUploading] = useState(false);

  const { getRootProps, getInputProps, isDragActive } = useDropzone({
    accept: {
      'text/plain': ['.log', '.json'],
      'application/json': ['.json'],
    },
    onDrop: (acceptedFiles) => {
      console.log('Log files dropped:', acceptedFiles);
      // Simulate upload
      setIsUploading(true);
      let progress = 0;
      const interval = setInterval(() => {
        progress += 10;
        setUploadProgress(progress);
        if (progress >= 100) {
          clearInterval(interval);
          setIsUploading(false);
          setUploadProgress(0);
        }
      }, 200);
    },
  });

  const mockLogs: LogEntry[] = [
    {
      id: '1',
      timestamp: '2024-01-15 14:30:00',
      source: 'vpc-flow-logs',
      type: 'vpc_flow',
      anomalies: 3,
      status: 'processed',
      size: '2.4 MB',
    },
    {
      id: '2',
      timestamp: '2024-01-15 14:25:00',
      source: 'cloudtrail-logs',
      type: 'cloudtrail',
      anomalies: 1,
      status: 'processed',
      size: '1.8 MB',
    },
    {
      id: '3',
      timestamp: '2024-01-15 14:20:00',
      source: 'iam-access-logs',
      type: 'iam',
      anomalies: 0,
      status: 'processing',
      size: '956 KB',
    },
  ];

  const getStatusColor = (status: string) => {
    switch (status) {
      case 'processed': return '#10b981';
      case 'processing': return '#f59e0b';
      case 'failed': return '#ef4444';
      default: return '#6b7280';
    }
  };

  const getTypeColor = (type: string) => {
    switch (type) {
      case 'vpc_flow': return '#6366f1';
      case 'cloudtrail': return '#06b6d4';
      case 'iam': return '#8b5cf6';
      default: return '#6b7280';
    }
  };

  return (
    <Container maxWidth="xl" sx={{ py: 4 }}>
      {/* Header */}
      <Box sx={{ mb: 6, textAlign: 'center' }}>
        <Typography variant="h1" sx={{ mb: 2 }}>
          Log Analysis
        </Typography>
        <Typography variant="body1" sx={{ fontSize: '1.2rem', mb: 4, maxWidth: 600, mx: 'auto' }}>
          Upload and analyze AWS logs for security anomalies and suspicious activities
        </Typography>
      </Box>

      <Grid container spacing={4}>
        {/* Upload Section */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent sx={{ p: 3 }}>
              <Typography variant="h4" sx={{ mb: 3 }}>
                Upload Logs
              </Typography>

              {/* Upload Area */}
              <Box
                {...getRootProps()}
                sx={{
                  border: '2px dashed rgba(99, 102, 241, 0.3)',
                  borderRadius: '12px',
                  p: 4,
                  textAlign: 'center',
                  cursor: 'pointer',
                  mb: 3,
                  backgroundColor: isDragActive ? 'rgba(99, 102, 241, 0.1)' : 'transparent',
                  '&:hover': {
                    backgroundColor: 'rgba(99, 102, 241, 0.05)',
                  },
                }}
              >
                <input {...getInputProps()} />
                <CloudUpload sx={{ fontSize: 64, color: '#6366f1', mb: 2 }} />
                <Typography variant="h6" sx={{ mb: 1 }}>
                  {isDragActive ? 'Drop log files here' : 'Drag & drop log files'}
                </Typography>
                <Typography variant="body2" color="text.secondary" sx={{ mb: 2 }}>
                  or click to select files
                </Typography>
                <Typography variant="caption" color="text.secondary">
                  Supported formats: VPC Flow Logs, CloudTrail, IAM Access Logs (.log, .json)
                </Typography>
              </Box>

              {/* Upload Progress */}
              {isUploading && (
                <Box sx={{ mb: 3 }}>
                  <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', mb: 1 }}>
                    <Typography variant="body2">Uploading...</Typography>
                    <Typography variant="body2">{uploadProgress}%</Typography>
                  </Box>
                  <LinearProgress
                    variant="determinate"
                    value={uploadProgress}
                    sx={{
                      height: 8,
                      borderRadius: 4,
                      backgroundColor: 'rgba(255, 255, 255, 0.1)',
                      '& .MuiLinearProgress-bar': {
                        background: 'linear-gradient(135deg, #6366f1 0%, #06b6d4 100%)',
                        borderRadius: 4,
                      },
                    }}
                  />
                </Box>
              )}

              {/* Supported Log Types */}
              <Alert
                severity="info"
                sx={{
                  backgroundColor: 'rgba(6, 182, 212, 0.1)',
                  border: '1px solid rgba(6, 182, 212, 0.2)',
                  '& .MuiAlert-icon': {
                    color: '#06b6d4',
                  },
                }}
              >
                <Typography variant="body2" sx={{ fontWeight: 600, mb: 1 }}>
                  Supported Log Types:
                </Typography>
                <Typography variant="body2">
                  • VPC Flow Logs - Network traffic analysis<br/>
                  • CloudTrail Logs - API activity monitoring<br/>
                  • IAM Access Logs - Identity and access events
                </Typography>
              </Alert>
            </CardContent>
          </Card>
        </Grid>

        {/* Analytics Overview */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent sx={{ p: 3 }}>
              <Typography variant="h4" sx={{ mb: 3 }}>
                Analytics Overview
              </Typography>

              <Grid container spacing={3}>
                <Grid item xs={6}>
                  <Box sx={{ textAlign: 'center' }}>
                    <Analytics sx={{ fontSize: 40, color: '#6366f1', mb: 1 }} />
                    <Typography variant="h3" sx={{ color: '#6366f1', mb: 1 }}>
                      1,247
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Logs Processed
                    </Typography>
                  </Box>
                </Grid>
                <Grid item xs={6}>
                  <Box sx={{ textAlign: 'center' }}>
                    <TrendingUp sx={{ fontSize: 40, color: '#ef4444', mb: 1 }} />
                    <Typography variant="h3" sx={{ color: '#ef4444', mb: 1 }}>
                      23
                    </Typography>
                    <Typography variant="body2" color="text.secondary">
                      Anomalies Found
                    </Typography>
                  </Box>
                </Grid>
              </Grid>

              <Box sx={{ mt: 4 }}>
                <Typography variant="h6" sx={{ mb: 2 }}>
                  Recent Anomalies
                </Typography>
                <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
                  <Box
                    sx={{
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'space-between',
                      p: 2,
                      borderRadius: '8px',
                      backgroundColor: 'rgba(239, 68, 68, 0.1)',
                      border: '1px solid rgba(239, 68, 68, 0.2)',
                    }}
                  >
                    <Box>
                      <Typography variant="body2" sx={{ fontWeight: 500 }}>
                        Suspicious IP Activity
                      </Typography>
                      <Typography variant="caption" color="text.secondary">
                        Multiple failed login attempts
                      </Typography>
                    </Box>
                    <Chip
                      label="High"
                      size="small"
                      sx={{
                        backgroundColor: 'rgba(239, 68, 68, 0.2)',
                        color: '#ef4444',
                        border: 'none',
                      }}
                    />
                  </Box>
                  <Box
                    sx={{
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'space-between',
                      p: 2,
                      borderRadius: '8px',
                      backgroundColor: 'rgba(245, 158, 11, 0.1)',
                      border: '1px solid rgba(245, 158, 11, 0.2)',
                    }}
                  >
                    <Box>
                      <Typography variant="body2" sx={{ fontWeight: 500 }}>
                        Unusual API Calls
                      </Typography>
                      <Typography variant="caption" color="text.secondary">
                        Off-hours administrative actions
                      </Typography>
                    </Box>
                    <Chip
                      label="Medium"
                      size="small"
                      sx={{
                        backgroundColor: 'rgba(245, 158, 11, 0.2)',
                        color: '#f59e0b',
                        border: 'none',
                      }}
                    />
                  </Box>
                </Box>
              </Box>
            </CardContent>
          </Card>
        </Grid>

        {/* Log History */}
        <Grid item xs={12}>
          <Card>
            <CardContent sx={{ p: 3 }}>
              <Box sx={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', mb: 3 }}>
                <Typography variant="h4">Log Processing History</Typography>
                <IconButton
                  sx={{
                    '&:hover': {
                      backgroundColor: 'rgba(99, 102, 241, 0.1)',
                    },
                  }}
                >
                  <Refresh />
                </IconButton>
              </Box>

              <TableContainer component={Paper} sx={{ backgroundColor: 'transparent' }}>
                <Table>
                  <TableHead>
                    <TableRow>
                      <TableCell>Timestamp</TableCell>
                      <TableCell>Source</TableCell>
                      <TableCell>Type</TableCell>
                      <TableCell>Size</TableCell>
                      <TableCell>Anomalies</TableCell>
                      <TableCell>Status</TableCell>
                      <TableCell>Actions</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {mockLogs.map((log) => (
                      <TableRow
                        key={log.id}
                        sx={{
                          '&:hover': {
                            backgroundColor: 'rgba(255, 255, 255, 0.02)',
                          },
                        }}
                      >
                        <TableCell>
                          <Typography variant="body2" sx={{ fontFamily: 'monospace' }}>
                            {log.timestamp}
                          </Typography>
                        </TableCell>
                        <TableCell>
                          <Typography variant="body2" sx={{ fontWeight: 500 }}>
                            {log.source}
                          </Typography>
                        </TableCell>
                        <TableCell>
                          <Chip
                            label={log.type.replace('_', ' ').toUpperCase()}
                            size="small"
                            sx={{
                              backgroundColor: `${getTypeColor(log.type)}20`,
                              color: getTypeColor(log.type),
                              border: 'none',
                              fontWeight: 600,
                            }}
                          />
                        </TableCell>
                        <TableCell>
                          <Typography variant="body2" color="text.secondary">
                            {log.size}
                          </Typography>
                        </TableCell>
                        <TableCell>
                          <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                            <Typography variant="body2" sx={{ fontWeight: 600 }}>
                              {log.anomalies}
                            </Typography>
                            {log.anomalies > 0 && (
                              <Chip
                                label="Review"
                                size="small"
                                sx={{
                                  backgroundColor: 'rgba(239, 68, 68, 0.1)',
                                  color: '#ef4444',
                                  border: 'none',
                                }}
                              />
                            )}
                          </Box>
                        </TableCell>
                        <TableCell>
                          <Chip
                            label={log.status.toUpperCase()}
                            size="small"
                            sx={{
                              backgroundColor: `${getStatusColor(log.status)}20`,
                              color: getStatusColor(log.status),
                              border: 'none',
                              fontWeight: 600,
                            }}
                          />
                        </TableCell>
                        <TableCell>
                          <Box sx={{ display: 'flex', gap: 1 }}>
                            <IconButton
                              size="small"
                              sx={{ '&:hover': { backgroundColor: 'rgba(99, 102, 241, 0.1)' } }}
                            >
                              <Visibility fontSize="small" />
                            </IconButton>
                            <IconButton
                              size="small"
                              sx={{ '&:hover': { backgroundColor: 'rgba(6, 182, 212, 0.1)' } }}
                            >
                              <Download fontSize="small" />
                            </IconButton>
                          </Box>
                        </TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Logs;
